import React, {useState, useEffect} from 'react';
import axios from "axios";
import Anime from './Anime';

let url="https://api.jikan.moe/v3/anime/3";

const Home = () => {

    const [animes, setAnimes] = useState([]);

    useEffect(() =>
    {
        (async function()
        {
            try
            {
                const res = await axios.get(url);
                setAnimes(res.data.top);
                console.log(res.data.top);
            }
            catch(err)
            {
                console.log(err);
            }
        })();




    }, [])

    return (
        <div>
            {animes.map((anime)=>{return <Anime key={anime.rank} id={anime.rank} title={anime.title}/>})}
        </div>
    )
}

export default Home;
